import { useEffect,useState } from "react"
import { fetchStocks } from "../api_s/fetchStocks"
import Item from "./Item"
function StockList(){
    const [stocks,setStocks]=useState(null)
    const [lastUpdate,setLastUpdate]=useState(null)
    useEffect(()=>{
        fetchStocks().then(el=>{setStocks(el.data);setLastUpdate(el.timestamp)}).catch(err=>console.error(err))
    },[])
    return(
        <tbody>
            {stocks&& stocks.map(stock =><Item item={stock} key={stock.symbol}/>)}
            {lastUpdate&&<div>{lastUpdate}</div>}
        </tbody>
    )
}
export default StockList
